BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "formula_parametro" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_formula"	INTEGER NOT NULL,
	"id_ciclo_contable"	INTEGER NOT NULL,
	"valor"	NUMERIC
);
CREATE TABLE IF NOT EXISTS "partida_detalle" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_partida"	INTEGER NOT NULL,
	"id_cuenta"	INTEGER NOT NULL,
	"parcial"	NUMERIC,
	"debe"	NUMERIC,
	"haber"	NUMERIC,
	"tipo_cargo_abono"	INTEGER DEFAULT 1,
	"eliminado"	INTEGER NOT NULL DEFAULT 0
);
CREATE TABLE IF NOT EXISTS "cuenta_balance" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_ciclo_contable"	INTEGER NOT NULL,
	"id_cuenta"	INTEGER NOT NULL,
	"saldo_inicial"	NUMERIC,
	"saldo_final"	NUMERIC NOT NULL
);
CREATE TABLE IF NOT EXISTS "ciclo_contable_folios" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_ciclo_contable"	INTEGER NOT NULL,
	"id_cuenta"	INTEGER NOT NULL,
	"folio_mayor"	INTEGER NOT NULL
);
CREATE TABLE IF NOT EXISTS "partida" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_ciclo"	INTEGER NOT NULL,
	"id_tipo_partida"	INTEGER NOT NULL DEFAULT 0,
	"comentario"	TEXT NOT NULL,
	"fecha"	TEXT NOT NULL,
	"eliminado"	INTEGER NOT NULL DEFAULT 0,
	"folio"	INTEGER DEFAULT 0,
	"hora"	TEXT DEFAULT '08:00 AM'
);
CREATE TABLE IF NOT EXISTS "ciclo_contable" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_catalogo"	INTEGER NOT NULL,
	"titulo"	TEXT NOT NULL,
	"desde"	TEXT NOT NULL,
	"hasta"	TEXT,
	"tipo_sociedad"	INTEGER DEFAULT 0,
	"porcentaje_reserva_legal"	NUMERIC DEFAULT 7,
	"monto_maximo_ventas"	NUMERIC DEFAULT 50000,
	"porcentaje_min"	NUMERIC DEFAULT 25,
	"porcentaje_max"	NUMERIC DEFAULT 30,
	"eliminado"	INTEGER NOT NULL DEFAULT 0,
	"sin_libro_diario"	INTEGER DEFAULT 0
);
CREATE TABLE IF NOT EXISTS "formula" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_tipo_catalogo"	INTEGER,
	"id_cuenta"	INTEGER,
	"signo"	TEXT,
	"nombre"	TEXT,
	"tipo_cuenta_especial"	INTEGER,
	"posicion"	TEXT,
	"id_formula"	INTEGER,
	"tipo_formula"	TEXT,
	"eliminado"	INTEGER DEFAULT 0
);
CREATE TABLE IF NOT EXISTS "cuenta" (
	"id"	INTEGER NOT NULL,
	"id_tipo_catalogo"	INTEGER NOT NULL,
	"codigo"	TEXT NOT NULL,
	"ref"	TEXT,
	"nombre"	TEXT NOT NULL,
	"tipo_saldo"	TEXT NOT NULL,
	"ingresos"	TEXT,
	"egresos"	TEXT,
	"eliminado"	INTEGER NOT NULL DEFAULT 0,
	"es_restado"	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "tipo_catalogo" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"tipo"	TEXT NOT NULL,
	"ref"	TEXT,
	"color"	INTEGER DEFAULT 0,
	"libro_diario"	INTEGER DEFAULT 1,
	"libro_mayor"	INTEGER DEFAULT 0,
	"balanza_comprobacion"	INTEGER DEFAULT 0,
	"estado_resultado"	INTEGER DEFAULT 0,
	"balance_general"	INTEGER DEFAULT 0,
	"flujo_efectivo"	INTEGER DEFAULT 0,
	"cambios_patrimonio"	INTEGER DEFAULT 0,
	"nivel_mayorizar"	INTEGER DEFAULT 3,
	"eliminado"	INTEGER NOT NULL DEFAULT 0
);
CREATE TABLE IF NOT EXISTS "usuario" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_persona"	INTEGER NOT NULL,
	"nombre"	TEXT NOT NULL,
	"correo"	TEXT,
	"clave"	TEXT NOT NULL,
	"resetear_clave"	INTEGER NOT NULL DEFAULT 0,
	"pregunta1"	INTEGER,
	"respuesta1"	TEXT,
	"pregunta2"	INTEGER,
	"respuesta2"	TEXT,
	"pregunta3"	INTEGER,
	"respuesta3"	TEXT,
	"salt"	TEXT,
	FOREIGN KEY("id_persona") REFERENCES "persona"("id")
);
CREATE TABLE IF NOT EXISTS "metodo_bancaria" (
	"codigo"	INTEGER,
	"tipo"	TEXT,
	"cuenta"	TEXT,
	"tipo_catalogo"	INTEGER
);
CREATE TABLE IF NOT EXISTS "configuracion_usuario" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"id_usuario"	INTEGER NOT NULL,
	"id_ciclo_contable"	INTEGER,
	"avatar"	TEXT NOT NULL DEFAULT '/utils/avatar/avatar1.png'
);
CREATE TABLE IF NOT EXISTS "metodo_seguros" (
	"CODIGO"	INTEGER,
	"TIPO"	TEXT,
	"CONCEPTO"	TEXT,
	"tipo_catalogo"	INTEGER
);
CREATE TABLE IF NOT EXISTS "metodo_costos" (
	"Codigo"	TEXT,
	"Tipo"	TEXT,
	"Cuenta"	TEXT,
	"tipo_catalogo"	INTEGER
);
CREATE TABLE IF NOT EXISTS "metodo_sector_publico" (
	"Codigo"	INTEGER,
	"Tipo"	TEXT,
	"Concepto"	TEXT,
	"Ingresos"	TEXT,
	"Egresos"	TEXT,
	"tipo_catalogo"	INTEGER
);
CREATE TABLE IF NOT EXISTS "metodo_agricola_cultivo_cafe" (
	"Codigo"	INTEGER,
	"Tipo"	TEXT,
	"Cuenta"	TEXT,
	"tipo_catalogo"	INTEGER
);
CREATE TABLE IF NOT EXISTS "metodo_agricola_cultivo_ca√±a_azucar" (
	"codigo"	INTEGER,
	"cuenta"	TEXT,
	"Tipo"	TEXT,
	"tipo_catalogo"	INTEGER
);
CREATE TABLE IF NOT EXISTS "metodo_perpetuo" (
	"Codigo"	INTEGER,
	"Tipo"	TEXT,
	"Cuenta"	TEXT,
	"tipo_catalogo"	INTEGER
);
CREATE TABLE IF NOT EXISTS "metodo_analitico" (
	"Codigo"	INTEGER,
	"Tipo"	TEXT,
	"Cuenta"	TEXT,
	"tipo_catalogo"	INTEGER
);
CREATE TABLE IF NOT EXISTS "persona" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"nombres"	TEXT NOT NULL,
	"apellidos"	TEXT NOT NULL,
	"tipo"	INTEGER NOT NULL DEFAULT 1,
	"carnet"	TEXT
);

COMMIT;
